События в Java

Подход к обработке событий в Java основан на модели делегирования событий (delegation event model), определяющей стандартные и согласованные механизмы для генерации и обработки событий. Логика обработки события отделяется от логики пользовательского интерфейса, генерирующего эти события. Элемент пользовательского интерфейса может "делегировать" обработку события отдельному фрагменту кода. Концепция модели делегирования событий Источник генерирует событие (event) и посылает его одному или более слушателей (listeners). Слушатель ожидает до тех пор, пока не получит событие. Как только событие получено, слушатель обрабатывает его и возвращает управление.















Событие – объект, инкапсулирующий изменение состояния источника. Генерируется в результате взаимодействия пользователя с элементом в графическом интерфейсе (клик на экранной кнопке, ввод символа с клавиатуры, выбор элемента в списке и клик кнопкой мыши). Источник — объект, генерирующий событие. Генерация события происходит при изменении внутреннего состояния объекта. Источники могут генерировать более одного типа событий. Для обработки событий источник должен регистрировать слушателей. Каждый тип события имеет собственный метод регистрации. Общая форма регистрации слушателя:
public void addTypeListener(TypeListener el)
Type – это имя объекта события, el – ссылка на слушателя события.
Например, addKeyListener() – регистрация слушателя событий клавиатуры.
addMouseMotionListener() – регистрация слушателя движения мыши.
Когда событие сгенерировано, все зарегистрированные слушатели получают копию объекта события. Это называется групповой рассылкой события. Источник также может отменить регистрацию слушателя для определенного типа событий. Общая форма отмены регистрации слушателя:
public void removeTypeListener(TypeListener el)
Слушатель – объект, уведомляемый о возникновении события и выполняющий определенный набор действий (обработку события). Слушатель должен быть зарегистрирован одним или более источниками событий, чтобы получать уведомления о событиях определенного рода.
Слушатель должен реализовать методы для получения и обработки событий.
java.awt.event

Классы событий

ActionEvent – генерируется при нажатии кнопки, двойном щелчке на элементе списка либо выборе пункта меню.
AdjustmentEvent – генерируется при изменении состояния прокручивающегося элемента.
ComponentEvent – генерируется при сокрытии компонента, его перемещении, изменении его размера либо включении видимости.
ContainerEvent – генерируется при добавлении или исключении компонента из контейнера.
FocusEvent – генерируется, когда компонент получает или теряет фокус клавиатурного ввода.
InputEvent – абстрактный суперкласс для всех классов ввода компонентов.
ItemEvent – генерируется при щелчке на флажке или элементе списка, при выборе элемента списка, отметке или снятии отметки пункта меню.
KeyEvent – генерируется при получении ввода с клавиатуры.
MouseEvent – генерируется при перетаскивании, перемещении, щелчках, нажатии и отпускании кнопок мыши; также возникает, когда курсор мыши входит на компонент либо покидает его.
MouseWheelEvent – генерируется при прокрутке колесика мыши.
TextEvent – генерируется при изменении значения текстовой области или текстового поля.
WindowEvent – генерируется при активизации либо закрытии окна, а также при деактивизации, свертывании, развертывании или выходе из него.

Интерфейсы слушателей
ActionListener
     • void actionPerformed(ActionEvent ae) (возникновение события действия)
AdjustmentListener
    • void adjustmentValueChanged(AdjustmentEvent ae) (возникновение события настройки)
ComponentListener
    • void componentResized(ComponentEvent се) (изменение размера компонента)
    • void componentMoved(ComponentEvent ce) (перемещение компонента)
    • void componentShown(ComponentEvent ce) (отображение компонента)
    • void componentHidden(ComponentEvent ce) (сокрытие компонента)
ContainerListener
    • void componentAdded(ContainerEvent ce) (компонент добавляется к контейнеру)
    • void componentRemoved(ContainerEvent ce) (компонент удаляется из контейнеру)
ItemListener
    • void itemStateChanged(ItemEvent ie) (изменение состояния элемента)
FocusListener
   • void focusGained(FocusEvent fe) (компонент получает фокус клавиатурного ввода)
   • void focusLost(FocusEvent fe) (компонент теряет фокус ввода)
KeyListener
   • void keyPressed(KeyEvent ke) (нажатие клавиши)
   • void keyReleased(KeyEvent ke) (отпускание клавиши)
   • void keyTyped(KeyEvent ke) (ввод символа)
MouseListener
   • void mouseClicked(MouseEvent me) (кнопка мыши нажата и отпущена в одной и той же точке)
   • void mouseEntered(MouseEvent me) (курсор мыши входит на поле компонента)
   • void mouseExited(MouseEvent me) (курсор мыши покидает поле компонента)
   • void mousePressed(MouseEvent me) (кнопка мыши нажимается)
   • void mouseReleased(MouseEvent me) (кнопка мыши отпускается)
MouseWheelListener
   • void mouseWheelMoved(MouseWheelEvent mwe) (прокрутка колесика мыши)
MouseMotionListener
   • void mouseDragged(MouseEvent me) (выполнение мышью перетаскивания)
   • void mouseMoved(MouseEvent me) (перемещение курсора мыши)
TextListener
   • void textChanged(ТехtEvent te) (изменение содержимого текстовой области или текстового поля.)
WindowFocusListener
   • void windowGainedFocus(WindowEvent we) (окно получает фокус ввода)
   • void windowLostFocus (WindowEvent we) (окно утрачивает фокус ввода)
WindowListener
   • void windowActivated(WindowEvent we) (окно активизируется)
   • void windowClosed(WindowEvent we) (окно закрывается)
   • void windowDeactivated(WindowEvent we) (окно деактивизируется)
   • void windowDeiconified(WindowEvent we) (окно разворачивается)
   • void windowlconified(WindowEvent we) (окно сворачивается в пиктограмму)
   • void windowOpened(WindowEvent we) (окно открывается)

Использование модели делегирования событий
   • реализовать соответствующий интерфейс в слушателе, чтобы он мог принимать события нужного типа.
   • реализовать код регистрации и отмены регистрации (при необходимости) слушателя как получателя уведомлений о событии.
Следует помнить, что источник может генерировать несколько типов событий. Каждое событие должно быть зарегистрировано отдельно. К тому же слушатель может подписаться на получение нескольких типов событий и должен реализовать все интерфейсы, необходимые для получения этих событий.
import java.awt.*;
import java.awt.event.*;
import java.applet.*;
public class MouseEvents extends Applet implements
MouseListener, MouseMotionListener {
 String msg = "";
 int mouseX = 0, mouseY = 0; // координаты курсора мыши
 public void init() {
 addMouseListener(this);
 addMouseMotionListener(this);
 }
 // Обработка щелчка
 public void mouseClicked(MouseEvent me) {
 // сохранить координаты
 mouseX = 0;
 mouseY = 10;
 msg = "Щелчок кнопкой мыши.";
 repaint();
 }
// Обработка входа курсора
 public void mouseEntered(MouseEvent me) {
 // сохранить координаты
 mouseX = 0;
 mouseY =10;
 msg = "Курсор мыши вошел.";
 repaint();
 }
 // Обработка выхода курсора
 public void mouseExited(MouseEvent me) {
 // сохранить координаты
 mouseX = 0;
 mouseY = 10;
 msg = "Курсор мыши вышел.";
 repaint();
 }
 // Обработка нажатия кнопки
 public void mousePressed(MouseEvent me) {
 // сохранить координаты
 mouseX = me.getX();
 mouseY = me.getY() ;
 msg = "Вниз";
 repaint();
 }
 // Обработка отпускания кнопки
 public void mouseReleased(MouseEvent me) {
 // сохранить координаты
 mouseX = me.getX() ;
 mouseY = me.getY();
 msg = "Вверх";
 repaint();
 }
// Обработка перетаскивания
 public void mouseDragged(MouseEvent me) {
 // сохранить координаты
 mouseX = me.getX();
 mouseY = me.getY();
 msg = "*";
 showStatus ("Перетаскивание мыши в " + mouseX + ", " +
mouseY);
 repaint();
 }
 // Обработка движения
 public void mouseMoved(MouseEvent me) {
 // Показать состояние
 showStatus ("Перемещение мыши в " + me.getX() + ", " +
me.getY());
 }
 // Отобразить msg в окне аплета в текущей позиции X,Y.
 public void paint(Graphics g) {
 g.drawString(msg, mouseX, mouseY);
 }
}

Ключевое слово this может использоваться внутри любого метода для ссылки на текущий объект. this всегда служит ссылкой на объект, для которого был вызван метод.
import java.applet.*;
import java.awt.*;
import java.awt.event.*;
public class KeyEvents extends Applet implements KeyListener {
 int mX = 10, mY = 10;
 public void init() {
 addKeyListener(this);
 }
 public void paint(Graphics g) {
 g.setColor(Color.red);
 g.fillOval(mX, mY, 100, 100);
 g.setColor(Color.black);
 g.drawOval(mX, mY, 100, 100);
 }
 public void keyTyped(KeyEvent e) {
 // пустая реализация
 }
 public void keyPressed(KeyEvent e) {
 // пустая реализация
 }
 public void keyReleased(KeyEvent e) {
 if(e.getKeyCode()== KeyEvent.VK_UP) {
 mY = mY-10;
 repaint();
 }
 if(e.getKeyCode()== KeyEvent.VK_DOWN) {
 mY = mY+10;
 repaint();
 }
 if(e.getKeyCode()== KeyEvent.VK_LEFT) {
 mX = mX-10;
 repaint();
 }
 if(e.getKeyCode()== KeyEvent.VK_RIGHT) {
 mX = mX+10;
 repaint();
 }
 }
}

Классы адаптеров

Класс адаптера предлагает пустую реализацию всех методов интерфейса слушателя событий, тем самым упрощает реализацию обработчиков событий. Классы адаптеров удобны, когда необходимо принимать и обрабатывать только некоторые из объявленных в интерфейсе слушателя событий.













Например, класс MouseMotionAdapter имеет два метода: mouseDragged() и mouseMoved(), которые являются методами, определенными в интерфейсе MouseMotionListener. Если приложению необходимо обрабатывать только события перетаскивания мыши можно просто расширить MouseMotionAdapter и переопределить
mouseDragged().
import java.applet.*;
import java.awt.*;
import java.awt.event.*;
public class AdapterKeyEvents extends Applet{
 int mX = 10, mY = 10;
 public void init() {
 addKeyListener(new MyKeyAdapter(this));
 }
public void paint(Graphics g) {
 g.setColor(Color.red);
 g.fillOval(mX, mY, 100, 100);
 g.setColor(Color.black);
 g.drawOval(mX, mY, 100, 100);
 }
}
class MyKeyAdapter extends KeyAdapter {
 AdapterKeyEvents ref;
 public MyKeyAdapter(AdapterKeyEvents refApplet) {
 ref = refApplet;
 }
 public void keyReleased(KeyEvent e) {
 if(e.getKeyCode()== KeyEvent.VK_UP) {
 ref.mY = ref.mY-10;
 ref.repaint();
 }
 if(e.getKeyCode()== KeyEvent.VK_DOWN) {
 ref.mY = ref.mY+10;
 ref.repaint();
 }
 if(e.getKeyCode()== KeyEvent.VK_LEFT) {
 ref.mX = ref.mX-10;
 ref.repaint();
 }
 if(e.getKeyCode()== KeyEvent.VK_RIGHT) {
 ref.mX = ref.mX+10;
 ref.repaint();
 }
 }
}

Анонимные вложенные классы

Анонимный вложенный класс – это класс, определенный внутри другого класса или даже внутри выражения, и которому не назначено имя. Использование анонимных вложенных классов позволяет значительно облегчить написание обработчиков событий.
import java.applet.*;
import java.awt.*;
import java.awt.event.*;
public class AIKeyEvents extends Applet {
 int mX = 10, mY = 10;
public void init() {
 this.addKeyListener(new KeyAdapter(){
 public void keyReleased(KeyEvent e) {
 if(e.getKeyCode() == KeyEvent.VK_UP) {
 mY = mY-10;
 repaint();
 }
 if(e.getKeyCode() == KeyEvent.VK_DOWN) {
 mY = mY+10;
 repaint();
 }
 if(e.getKeyCode() == KeyEvent.VK_LEFT) {
 mX = mX-10;
 repaint();
 }
 if(e.getKeyCode() == KeyEvent.VK_RIGHT) {
 mX = mX+10;
 repaint();
 }
 }
 });
}
public void paint(Graphics g) {
 g.setColor(Color.red);
 g.fillOval(mX, mY, 100, 100);
 g.setColor(Color.black);
 g.drawOval(mX, mY, 100, 100);
 }
}
Синтаксис new KeyAdapter(){...} указывает компилятору, что код между фигурными скобками определяет анонимный вложенный класс. Новый класс не имеет имени, но его экземпляр автоматически создается при выполнении этого выражения. Поскольку анонимный вложенный класс определен внутри контекста класса AIKeyEvents, он имеет доступ ко всем переменным и методам этого класса.
